import React from 'react';
import './styles/style.css';
import ExampleComponent from './components/ExampleComponent';

const App: React.FC = () => {
    return (
        <div className="App">
            <header className="hero">
                <h1>Welcome to My Professional App</h1>
                <p className="highlight">Enhancing your experience with modern design.</p>
            </header>
            <main>
                <section>
                    <h2>About This App</h2>
                    <p>This application is designed to showcase the use of React with TypeScript.</p>
                </section>
                <ExampleComponent />
            </main>
            <footer>
                <p>&copy; 2023 My Professional App. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default App;
